function About() {
  return (
    <div>
      <h4 className="m-3">About</h4>
      <p className="m-3">
        CampusContact is a Peer-2-Peer Campus Voter Canvassing tool.
      </p>
      <p className="m-3">
        Developed by Pratyush Mallick, Albert Qi, and Gary Wu.
      </p>
    </div>
  );
}

export default About;
